import "./Intro.css";
import Image1 from '../img/step01.JPG';

const Step = ({num, subtitle}) => {
    return (
      <div class = "step">
        <div class = "step_img">
          <img src = {Image1} />
        </div>
        <div class = "step-A">
          <div class = "title">
            {num}
          </div>
          <div class = "subtitle">
            {subtitle}
          </div>
        </div>
        <div class = "step-B">
          <div class = "detailtext">
            Write the Detail Text
          </div>
        </div>
      </div>
    );
}


const Intro = () => {
  return (
    <div class = "intro">
        <div class = "left-box">
            <div> Animal Behavior </div>
            <div> Briefly Analyze in <strong> B-fact </strong></div>
        </div>
        <div class = "right-box">
          <Step num = "2" subtitle = "붉은 달에 태양을 주시어"/>
        </div>
    </div>
  );
}

export default Intro;
